import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { productsController } from "../../controllers/product-page";
import "../../css/products-main.css";
import DownChevron from "../../icons/down-chevron";

const Product = ({ ...props }) => {
  let { productId } = useParams();
  const [productsList, setProductsList] = useState([]);
  const categories = [
    "Remote Patient Monitoring",
    "Prosthodontics",
    "Virtual Examination Room",
  ];

  useEffect(() => {
    productsController.getProducts().then((response) => {
      setProductsList(response.data);
    });
  });

  return (
    <div className="container">
      <div className="row">
        <div className="col-3">
          <strong>Refine your search</strong>
        </div>

        <div className="col-9">
          <input
            type="text"
            placeholder="Search: Place Holder: Company name, Device name , category of this devices"
            className="product-search-input"
          />
        </div>
      </div>
      <br />
      <div className="category-filter d-flex justify-content-between">
        <div className="categories-div d-flex align-items-center">
          {categories.map((category, i) => {
            return <div className="category">{category}</div>;
          })}
        </div>
        <button className="advanced-search-btn d-flex align-items-center">
          Advanced Search <DownChevron />
        </button>
      </div>
      <div className="advanced-search-div">
        <strong>Filter by</strong>
        <br />
        <div className="filter-keys d-flex justify-content-between">
          <div className="key">
            <a
              className="nav-link dropdown-toggle d-flex justify-content-center align-items-center"
              href="#"
              id="filter-by-price"
              role="button"
              data-bs-toggle="dropdown"
              aria-expanded="false"
            >
              <span>Price</span>
            </a>
          </div>
          <div className="key">
            <span>Most Bought</span>
          </div>
          <div className="key">
            <span>Partner</span>
          </div>
          <br />
          <div
            aria-labelledby="filter-by-price"
            className="filter-by-price"
          >
            sss
          </div>
        </div>
      </div>
    </div>
  );
};

export default Product;
